script: |
  super -f text -I q5966.spq | sort > q5966.out

inputs:
  - name: q5966.spq
    data: |
      SELECT - col0 + + - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 NOT BETWEEN 92 AND - col2 * 68;
  - name: tab1

outputs:
  - name: q5966.out
    data: |
      -144
      -147
      -159
